Verenigde Staten
Drama

geregisseerd door Carl T. Evans
met Carl T. Evans, Arija Bareikis en Chris Noth

New Jersey Detective David Secca's leven verandert voorgoed wanneer hij een stuk film in een antieke doos ontdekt. Op de film is een man te zien die een geweer verbergt, op een grassig heuveltje. Hetzelfde heuveltje waar president John F. Kennedy voorbij ging toen hij vermoord werd. Maar is de film authentiek, of is het bedrog?


